    "Fast, modern and advanced photo management suite" : "Γρήγορο, μοντέρνο και προηγμένο σύνολο διαχείρισης φωτογραφιών",
    "# Memories: Photo Management for Nextcloud\n\nMemories is a *batteries-included* photo management solution for Nextcloud with advanced features including:\n\n- **📸 Timeline**: Sort photos and videos by date taken, parsed from Exif data.\n- **⏪ Rewind**: Jump to any time in the past instantly and relive your memories.\n- **🤖 AI Tagging**: Group photos by people and objects, powered by [recognize](https://github.com/nextcloud/recognize) and [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Albums**: Create albums to group photos and videos together. Then share these albums with others.\n- **🫱🏻‍🫲🏻 External Sharing**: Share photos and videos with people outside of your Nextcloud instance.\n- **📱 Mobile Support**: Work from any device, of any shape and size through the web app.\n- **✏️ Edit Metadata**: Edit dates and other metadata on photos quickly and in bulk.\n- **📦 Archive**: Store photos you don't want to see in your timeline in a separate folder.\n- **📹 Video Transcoding**: Transcode videos and use HLS for maximal performance.\n- **🗺️ Map**: View your photos on a map, tagged with accurate reverse geocoding.\n- **📦 Migration**: Migrate easily from Nextcloud Photos and Google Takeout.\n- **⚡️ Performance**: Do all this very fast.\n\n## 🚀 Installation\n\n1. Install the app from the Nextcloud app store (try a demo [here](https://demo.memories.gallery/apps/memories/)).\n1. Perform the recommended [configuration steps](https://memories.gallery/config/).\n1. Run `php occ memories:index` to generate metadata indices for existing photos.\n1. Open the 📷 Memories app in Nextcloud and set the directory containing your photos." : "# Memories: Διαχείριση Φωτογραφιών για Nextcloud\n\nΤο Memories είναι μια *πλήρης* λύση διαχείρισης φωτογραφιών για το Nextcloud με προηγμένες λειτουργίες όπως:\n\n- **📸 Χρονολόγιο**: Ταξινόμηση φωτογραφιών και βίντεο ανά ημερομηνία λήψης, από δεδομένα Exif.\n- **⏪ Επανάληψη**: Μετάβαση σε οποιαδήποτε στιγμή στο παρελθόν αμέσως και αναβίωση των αναμνήσεών σας.\n- **🤖 Ετικετοποίηση AI**: Ομαδοποίηση φωτογραφιών ανά άτομα και αντικείμενα, με χρήση [recognize](https://github.com/nextcloud/recognize) και [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Άλμπουμ**: Δημιουργία άλμπουμ για ομαδοποίηση φωτογραφιών και βίντεο. Στη συνέχεια, μοιραστείτε αυτά τα άλμπουμ με άλλους.\n- **🫱🏻‍🫲🏻 Εξωτερικός Διαμοιρασμός**: Διαμοιρασμός φωτογραφιών και βίντεο με άτομα εκτός του Nextcloud σας.\n- **📱 Υποστήριξη Κινητών**: Εργασία από οποιαδήποτε συσκευή, οποιουδήποτε σχήματος και μεγέθους μέσω της εφαρμογής web.\n- **✏️ Επεξεργασία Μεταδεδομένων**: Επεξεργασία ημερομηνιών και άλλων μεταδεδομένων σε φωτογραφίες γρήγορα και μαζικά.\n- **📦 Αρχειοθέτηση**: Αποθήκευση φωτογραφιών που δεν θέλετε να βλέπετε στο χρονολόγιό σας σε ξεχωριστό φάκελο.\n- **📹 Μετακωδικοποίηση Βίντεο**: Μετακωδικοποίηση βίντεο και χρήση HLS για μέγιστη απόδοση.\n- **🗺️ Χάρτης**: Προβολή των φωτογραφιών σας σε χάρτη, με ετικέτες ακριβούς αντιστροφής γεωκωδικοποίησης.\n- **📦 Μετεγκατάσταση**: Εύκολη μετεγκατάσταση από το Nextcloud Photos και το Google Takeout.\n- **⚡️ Απόδοση**: Κάντε όλα αυτά πολύ γρήγορα.\n\n## 🚀 Εγκατάσταση\n\n1. Εγκαταστήστε την εφαρμογή από το κατάστημα εφαρμογών Nextcloud (δοκιμάστε μια επίδειξη [εδώ](https://demo.memories.gallery/apps/memories/)).\n1. Εκτελέστε τα προτεινόμενα [βήματα διαμόρφωσης](https://memories.gallery/config/).\n1. Εκτελέστε `php occ memories:index` για να δημιουργήσετε ευρετήρια μεταδεδομένων για υπάρχουσες φωτογραφίες.\n1. Ανοίξτε την εφαρμογή 📷 Memories στο Nextcloud και ορίστε τον κατάλογο που περιέχει τις φωτογραφίες σας.",
